const backendURL = "https://e7ec9c2btrial-dev-budgetly-srv.cfapps.us10-001.hana.ondemand.com";

/*
get plan data by userid
create plan
get monthly data by planID
create month in plan
*/

const testApi = async () => {
    console.log("fetch");
    const response = await fetch(`${backendURL}/test`, {
        method: 'GET',
        mode: 'no-cors',
    });
    console.log(response)
    const res = await response.json();
    return res;
}

const getPlan = async (user_uuid) => {
    const response = await fetch(`${backendURL}/budgetPlan/${user_uuid}`);
    const res = await response.json();
    return res;
}

const createPlan = async (plan) => {
    const response = await fetch(`${backendURL}/budgetPlan`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: plan
    });
    const res = await response.json();
    console.log(res);
    return res;
}

const getMonth = async (month_id) => {
    const response = await fetch(`${backendURL}/month/${month_id}`);
    const res = await response.json();
    return res;
};


const getMonths = async (plan_id) => {
    const response = await fetch(`${backendURL}/monthlyPlan/${plan_id}`);
    const res = await response.json();
    return res;
}

const createMonth = async (month) => {
    const response = await fetch(`${backendURL}/monthlyPlan`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: month
    });
    const res = await response.json();
    console.log(res);
    return res;
}


const createEvent = async (eventData) => {
    const response = await fetch(`${backendURL}/event`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: eventData
    });
    const res = await response.json();
    console.log(res);
    return res;
}

export { getPlan, createPlan, testApi }
